/**
 * BAZONIA - SEARCH KEYWORDS v1.0.0
 * Genera queries para ZINC Search API
 * 100 productos = ~7 búsquedas (16 por página)
 */

const searches = [
  // TECNOLOGÍA (35 productos)
  { query: "laptop computer", category: "Tecnología" },
  { query: "wireless headphones bluetooth", category: "Tecnología" },
  { query: "smartwatch fitness", category: "Tecnología" },

  // ZAPATOS (35 productos)
  { query: "men running shoes", category: "Zapatos" },
  { query: "women casual shoes", category: "Zapatos" },

  // SALUD Y DEPORTES (30 productos)
  { query: "protein powder supplement", category: "Salud y Deportes" },
  { query: "vitamins multivitamin", category: "Salud y Deportes" }
];

return searches.map(s => ({ json: s }));

/**
 * EXTRACT PRODUCTS v1.0.0
 * Extrae productos de ZINC Search, elimina duplicados, limita a 100
 */

const MAX_PRODUCTS = 100;
const seen = new Set();
const products = [];

// Recorrer todas las búsquedas
for (const item of $input.all()) {
  const searchData = item.json;
  const results = searchData.results || [];

  // Obtener categoría del input original (viene del nodo anterior via pairedItem)
  // Como no tenemos acceso directo, la inferimos del query
  let category = "General";

  for (const product of results) {
    const asin = product.product_id;

    // Saltar duplicados
    if (!asin || seen.has(asin)) continue;
    seen.add(asin);

    // Saltar productos sin precio
    if (!product.price) continue;

    products.push({
      json: {
        asin: asin,
        title: product.title || "",
        image: product.image || "",
        price_cents: product.price,
        price_usd: (product.price / 100).toFixed(2),
        num_reviews: product.num_reviews || 0,
        num_sales: product.num_sales || null,
        prime: product.prime || false,
        source: "zinc_search"
      }
    });

    // Limitar a MAX_PRODUCTS
    if (products.length >= MAX_PRODUCTS) break;
  }

  if (products.length >= MAX_PRODUCTS) break;
}

// Log para debugging
console.log(`Total productos únicos: ${products.length}`);

//return products;

return products.slice(0, 7);

/**
 * BAZONIA PARSER v9.0.0
 * 
 * ESTRATEGIA:
 * - Productos CON variantes → Type: "variable" + Atributos WooCommerce + JSON
 * - Productos SIN variantes → Type: "simple"
 * - 1 FILA POR PRODUCTO (nunca múltiples)
 * - Plugin Bazonia lee JSON y maneja AJAX para precios
 * 
 * FLUJO FRONTEND:
 * 1. WooCommerce renderiza selectores nativos (por los atributos)
 * 2. Usuario cambia selección
 * 3. Plugin Bazonia intercepta, busca en JSON, hace AJAX si price=0
 * 4. Actualiza precio en pantalla
 */

const results = [];

// Procesar cada item del input
for (const item of $input.all()) {
  const zinc = item.json;

  // Validar que existe data
  if (!zinc || !zinc.product_id) {
    continue;
  }

  // ============================================
  // 1. DATOS BÁSICOS
  // ============================================

  const asin = zinc.product_id;
  const parentAsin = zinc.parent_asin || asin;
  const title = zinc.title || '';
  const brand = zinc.brand || '';
  const price = zinc.price ? (zinc.price / 100).toFixed(2) : '';
  const sku = `AMZ-${asin}`;

  // ============================================
  // 2. DETECTAR SI TIENE VARIANTES
  // ============================================

  const hasVariants = zinc.all_variants && 
                      Array.isArray(zinc.all_variants) && 
                      zinc.all_variants.length > 1;

  // ============================================
  // 3. CONSTRUIR ATRIBUTOS Y JSON DE VARIANTES
  // ============================================

  let productType = 'simple';
  let attr1Name = '', attr1Values = '';
  let attr2Name = '', attr2Values = '';
  let attr3Name = '', attr3Values = '';
  let variantsJson = '';
  let variantsCount = 0;

  if (hasVariants) {
    productType = 'variable';
    variantsCount = zinc.all_variants.length;

    // Recolectar todos los atributos únicos
    const attributes = {}; // { "Color": Set(["Red", "Blue"]), ... }
    const variantsArray = [];

    for (const variant of zinc.all_variants) {
      const vid = variant.asin || variant.product_id || '';
      const specs = variant.variant_specifics || [];

      // Objeto de specs para esta variante
      const variantSpecs = {};

      for (const spec of specs) {
        const name = spec.dimension || '';
        const value = spec.value || '';

        if (name && value) {
          // Agregar a atributos globales
          if (!attributes[name]) {
            attributes[name] = new Set();
          }
          attributes[name].add(value);

          // Agregar a specs de esta variante
          variantSpecs[name] = value;
        }
      }

      // ¿Es la variante actual?
      const isCurrentVariant = vid === asin;

      // Construir objeto de variante para JSON
      variantsArray.push({
        id: vid,
        price: isCurrentVariant ? parseFloat(price) || 0 : 0,
        image: variant.image || '',
        specs: variantSpecs
      });
    }

    // Convertir atributos a formato WooCommerce
    // WooCommerce usa | como separador de valores
    const attrNames = Object.keys(attributes);

    if (attrNames[0]) {
      attr1Name = attrNames[0];
      attr1Values = Array.from(attributes[attrNames[0]]).join('|');
    }
    if (attrNames[1]) {
      attr2Name = attrNames[1];
      attr2Values = Array.from(attributes[attrNames[1]]).join('|');
    }
    if (attrNames[2]) {
      attr3Name = attrNames[2];
      attr3Values = Array.from(attributes[attrNames[2]]).join('|');
    }

    // JSON de variantes
    variantsJson = JSON.stringify(variantsArray);
  }

  // ============================================
  // 4. PESO Y DIMENSIONES
  // ============================================

  let weight = '';
  let length = '', width = '', height = '';

  // Peso
  if (zinc.package_dimensions?.weight) {
    const w = zinc.package_dimensions.weight;
    if (typeof w === 'object' && w.amount && w.unit) {
      const val = parseFloat(w.amount);
      const unit = (w.unit || '').toLowerCase();
      if (unit.includes('pound') || unit.includes('lb')) {
        weight = (val * 0.453592).toFixed(2);
      } else if (unit.includes('ounce') || unit.includes('oz')) {
        weight = (val * 0.0283495).toFixed(2);
      } else {
        weight = val.toFixed(2);
      }
    }
  }

  // Dimensiones
  if (zinc.package_dimensions?.size) {
    const s = zinc.package_dimensions.size;
    const convert = (dim) => {
      if (!dim || typeof dim !== 'object') return '';
      const val = parseFloat(dim.amount || 0);
      const unit = (dim.unit || '').toLowerCase();
      if (unit.includes('inch')) return (val * 2.54).toFixed(1);
      return val.toFixed(1);
    };
    length = convert(s.length);
    width = convert(s.width);
    height = convert(s.depth) || convert(s.height);
  }

  // ============================================
  // 5. IMÁGENES
  // ============================================

  const images = [];
  if (zinc.main_image) images.push(zinc.main_image);
  if (zinc.images && Array.isArray(zinc.images)) {
    for (const img of zinc.images) {
      if (img && !images.includes(img)) images.push(img);
    }
  }

  // ============================================
  // 6. DESCRIPCIONES (limpias, sin saltos de línea problemáticos)
  // ============================================

  let shortDesc = '';
  let longDesc = '';

  if (zinc.feature_bullets && Array.isArray(zinc.feature_bullets)) {
    shortDesc = (zinc.feature_bullets[0] || '').replace(/[\r\n]+/g, ' ').trim();
    longDesc = zinc.feature_bullets
      .map(b => b.replace(/[\r\n]+/g, ' ').trim())
      .filter(b => b)
      .map(b => `<li>${b}</li>`)
      .join('');
    if (longDesc) longDesc = `<ul>${longDesc}</ul>`;
  }

  // ============================================
  // 7. UPC
  // ============================================

  let upc = '';
  if (zinc.epids_map?.UPC) {
    upc = zinc.epids_map.UPC;
  } else if (zinc.upc) {
    upc = zinc.upc;
  }

  // ============================================
  // 8. CONSTRUIR FILA
  // ============================================

  const now = new Date().toISOString();

  const row = {
    // WooCommerce Core
    'ID': '',
    'Type': productType,
    'SKU': sku,
    'Name': title,
    'Published': '1',
    'Is featured?': '0',
    'Visibility in catalog': 'visible',
    'Short description': shortDesc,
    'Description': longDesc,
    'Tax status': 'taxable',
    'In stock?': '1',
    'Backorders allowed?': '0',
    'Sold individually?': '0',

    // Dimensiones
    'Weight (kg)': weight,
    'Length (cm)': length,
    'Width (cm)': width,
    'Height (cm)': height,

    // Precio (para simple; para variable el plugin maneja)
    'Regular price': price,

    // Categorías e imágenes
    'Categories': '',
    'Tags': brand,
    'Images': images.join(', '),

    // Atributos WooCommerce (para selectores nativos)
    'Attribute 1 name': attr1Name,
    'Attribute 1 value(s)': attr1Values,
    'Attribute 1 visible': attr1Name ? '1' : '',
    'Attribute 1 global': '0',
    'Attribute 2 name': attr2Name,
    'Attribute 2 value(s)': attr2Values,
    'Attribute 2 visible': attr2Name ? '1' : '',
    'Attribute 2 global': '0',
    'Attribute 3 name': attr3Name,
    'Attribute 3 value(s)': attr3Values,
    'Attribute 3 visible': attr3Name ? '1' : '',
    'Attribute 3 global': '0',

    // META: Bazonia
    'meta:_bazonia_asin': asin,
    'meta:_bazonia_parent_asin': parentAsin,
    'meta:_bazonia_brand': brand,
    'meta:_bazonia_upc': upc,
    'meta:_bazonia_url': `https://www.amazon.com/dp/${asin}`,
    'meta:_bazonia_prime': zinc.prime ? '1' : '0',

    // META: Variantes (CLAVE para plugin)
    'meta:_bazonia_has_variants': hasVariants ? '1' : '0',
    'meta:_bazonia_variants_count': String(variantsCount),
    'meta:_bazonia_variants_json': variantsJson,

// META: Reviews y Rating
'meta:_bazonia_stars': zinc.stars ? String(zinc.stars) : '',
'meta:_bazonia_reviews_count': String(zinc.num_reviews || 0),

// META: Sync
'meta:_bazonia_last_sync': now,
'meta:_bazonia_parser': 'v9.1.0'
  };

  results.push({ json: row });
}

return results;
